import React, { Component } from 'react';
import Post from './Post';

export default class Posts extends Component {
    render() {
        return (
            <div className="left">
                <Post src="https://hercanberra.com.au/wp-content/uploads/2019/06/Minions_feature.jpg" alt="inst"/>
                <Post src="https://media.tenor.com/images/8c5f10657b6f196c241f8087d21551e0/tenor.png" alt="second"/>
            </div>
        )
    }
}
